import React, { Fragment, Component } from "react";
import "./App.css";

class App extends Component {
  //foo = () => "Bars";

  render() {
    const name = "John Doe";
    const loading = true;
    const showName = true;
    // if (loading) {
    //   return <h4>Loading....</h4>;
    // }

    return (
      <Fragment>
        <h1>My App</h1>
        {loading ? (
          <h4>Loading...</h4>
        ) : (
          <h1>Hello {showName ? name : null}</h1>
        )}
      </Fragment>
    );
  }
}

export default App;
